import React from "react";

function Recommendation(props){
    const usertest = [];
    return (
        <div>
            <head>
                <title>당신의 전통주 취향은?</title>
            </head>
            <h2>{props.question}</h2>
            <div>
                <button onClick={
                    (event)=>usertest.push(1)}>{props.answer1}</button>
                <button onClick={usertest.push(2)}>{props.answer2}</button>
                <button onClick={usertest.push(3)}>{props.answer3}</button>
                <button onClick={usertest.push(4)}>{props.answer4}</button>
                <button onClick={usertest.push(5)}>{props.answer5}</button>
            </div>
            {usertest}
        </div>
    );
}
export default Recommendation;
